import React from 'react';
import { Cascader } from 'antd';
import { Menu } from 'antd';


const options = [
    {
      value: 'zhejiang',
      label: 'Zhejiang',
    }]
const onChange = (value) => {
    console.log(value);
    };
const NavbarReport = () => {
  return (
    <Menu style={{background:"white", width:"1120px", height:"70px"}}  mode="horizontal">


    <h4 style={{padding:"20px"}}> Reports </h4>
        <Cascader style={{padding:"5px"}} options={options} onChange={onChange} placeholder="Please select" />


    </Menu>

  )
}

export default NavbarReport
